import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Changed Switch to Routes
import { ThemeProvider } from './context/ThemeContext';
import { AuthProvider } from './context/AuthContext';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import UserDashboard from './pages/UserDashboard';
import AdminDashboard from './pages/AdminDashboard';
import PropertyDetailPage from './pages/PropertyDetailPage';
import RentPage from './pages/RentPage';
import Footer from './components/Footer';
import Navbar from './components/Navbar';

const App = () => (
  <ThemeProvider>
    <AuthProvider>
      <Router>
        <Navbar />
        <Routes> // Changed Switch to Routes
          <Route exact path="/" element={<HomePage />} /> // Changed component to element
          <Route path="/login" element={<LoginPage />} /> // Changed component to element
          <Route path="/register" element={<RegisterPage />} /> // Changed component to element
          <Route path="/dashboard" element={<UserDashboard />} /> // Changed component to element
          <Route path="/admin" element={<AdminDashboard />} /> // Changed component to element
          <Route path="/property/:id" element={<PropertyDetailPage />} /> // Changed component to element
          <Route path="/rent" element={<RentPage />} /> // Changed component to element
        </Routes>
        <Footer />
      </Router>
    </AuthProvider>
  </ThemeProvider>
);

export default App;
